import { Chess } from 'chess.js';


export const onDrop = (
    game: Chess,
    setFen: (fen: string) => void,
    moves: string[],
    sourceSquare: string,
    targetSquare: string,
): boolean => {
    try {
        const move = game.move({
            from: sourceSquare,
            to: targetSquare,
            promotion: 'q',
        });

        if (move) {
            const moveString: string = move.from + move.to + (move.promotion ? move.promotion : '');
            moves.push(moveString);

            setFen(game.fen());

            return true;
        }

        return false;
    } catch(e) {
        console.log(e);
        return false;
    }
};
